import "./header.css";
import { Turn as Hamburger } from "hamburger-react";
import { useNavigate } from "react-router-dom";

function Header() {
  return (
    <>
      <div className="header">
        <div className="logo" onClick={() => navigate("/your-path-here")}>
          code gallery
        </div>
        <Hamburger
          color="#f5f5f5"
          onToggle={(toggled) => {
            if (toggled) {
              alert("open");
            } else {
              alert("closed");
            }
          }}
        />
      </div>
    </>
  );
}

export default Header;
